import styled from "styled-components";

export const SquareStatusSuccess = styled.div`
    display: flex;
    width: 64px;
    height: 64px;
    background-color:#07CF5F};
    box-shadow: 0px 0px 6px rgba(50, 146, 255, 0.15);
    border-radius: 8px;
    align-items: center;
    position: relative;
    align-items: center;
    justify-content: center;
`

export const SquareStatusError = styled.div`
    display: flex;
    width: 64px;
    height: 64px;
    background-color:red};
    box-shadow: 0px 0px 6px rgba(50, 146, 255, 0.15);
    border-radius: 8px;
    align-items: center;
    position: relative;
    align-items: center;
    justify-content: center;
`

export const SquareFinalSuccess = styled.div`
    display: flex;
    width: auto;
    align-items: center;
    position: relative;
    align-items: center;
    justify-content: center;
`

export const SquareIcon = styled.div`
    display: flex;
    justify-content: center;
    width: 60%;
`

export const Mark =  styled.div`
        border-radius: 20px;
        background-color: #FF6B6B;
        color: #FFF;
`
